                                <p>Kolejny sukces SGGW w międzynarodowym rankingu szkół wyższych. Szkoła Główna Gospodarstwa Wiejskiego znalazła się na 34. miejscu wśród najlepszych światowych uczelni w dziedzinie rolnictwo i leśnictwo, w rankingu QS World University Rankings serwisu TopUniversities.com.  SGGW w ciągu ostatniego roku awansowała o kilkadziesiąt miejsc.  W klasyfikacji ogólnej tego rankingu SGGW zajmuje 12. miejsce wśród polskich uczelni. </p>
