                                <p>Pięć i pół tysiąca studentów pierwszego roku rozpoczęło naukę w Szkole Głównej Gospodarstwa Wiejskiego. Podczas inauguracji roku akademickiego nowo przyjęci studenci złożyli uroczyste ślubowanie, stając się pełnoprawnymi członkami społeczności akademickiej SGGW.</p>
