                                <p>Rektor-elekt Szkoły Głównej Gospodarstwa Wiejskiego w Warszawie prof. dr hab. Wiesław Bielawski został wybrany na funkcję wiceprzewodniczącego Konferencji Rektorów Akademickich Szkół Polskich (KRASP) na kadencję 2016-2020. Nowym przewodniczącym KRASP został prof. dr hab. Jan Szmidt, rektor Politechniki Warszawskiej. Drugim wiceprzewodniczącym został  prof. dr hab. Andrzej Tretyn, rektor Uniwersytetu Mikołaja Kopernika w Toruniu.</p>
