                                <p>W Szkole Głównej Gospodarstwa Wiejskiego w Warszawie otwarto Centrum Badań Biomedycznych. Na uruchomienie centrum przy Wydziale Medycyny Weterynaryjnej uczelnia otrzymała dofinansowanie w wysokości 30 mln zł, w ramach RPO WM 2007-2013. W nowoczesnych laboratoriach prowadzone będą innowacyjne badania z pogranicza weterynarii i medycyny. </p>
