                                <p>Szkoła Główna Gospodarstwa Wiejskiego dostała się do pierwszej setki najlepszych światowych uczelni w dziedzinie rolnictwo i leśnictwo.  QS World University Rankings serwisu TopUniversities.com jest już piątą edycją rankingu, który oprócz przeanalizowania około 17,3 mln prac badawczych, zebrał również opinie ponad 85 tysięcy naukowców i 41 tys. pracodawców. Zestawienie uwzględnia aż 36 różnych dyscyplin naukowych i jak podkreślają jego twórcy, jest to największa lista tego typu na świecie.</p>
